import React from "react";
import {
  StyleSheet,
  Text,
  View,
  TouchableWithoutFeedback,
  Alert,
} from "react-native";

export default function App() {
  return (
    <View style={styles.container}>
      <Text>...</Text>
      <TouchableWithoutFeedback
        onPress={() => Alert.alert("Se tocó el botón")}
      ><Text>Me la pela el botón</Text></TouchableWithoutFeedback>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
